from bs4 import BeautifulSoup
import requests

headers = {"User-Agent": "Mozilla/5.0 (Windows NT 6.0 x64;en-US;rv:1.9pre) Gecko/2008072421 Minefield/3.0.2pre"}
root_url = 'http://xh.5156edu.com/html/{}.html'
valid = []
result = {}
for i in range(1503):
    url = root_url.format(i + 1)
    print(url)
    response = requests.get(url)
    response.encoding = 'gb18030'
    html = response.text
    soup = BeautifulSoup(html, 'html.parser')
    title = soup.find('title').next[0]
    if title == 'æ— ':
        valid.append(url)
        continue
    tags = soup.find_all('a', class_="fontbox")
    words = []
    for tag in tags:
        value = tag.next
        words.append(value)
    result[title] = words

print(valid)
with open('bushou.txt', 'w', encoding='gb18030') as file:
    for title, words in result.items():
        file.write("{}\t{}\n".format(title, ''.join(words)))

